import { Box } from '@material-ui/core';
import {withStyles} from '@material-ui/styles';
import React from 'react';

const style = (theme) => ({
  searchTextField: {
    border: 'none'
  }
})

const Header = (props) => {
  return (
    <Box>
      <input />
    </Box>
  );
};

export default withStyles(style)(Header);
